import React from "react";
import { Route, Switch, Redirect, useHistory } from "react-router-dom";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";
import Login from "./Login";
import Register from "./Register";
import PopupWithForm from "./PopupWithForm";
import EditProfilePopup from "./EditProfilePopup";
import EditAvatarPopup from "./EditAvatarPopup";
import AddPlacePopup from "./AddPlacePopup";
import ImagePopup from "./ImagePopup";
import api from "../utils/api";
import * as auth from "../utils/auth.js";
import { CurrentUserContext } from "../contexts/CurrentUserContext";

import ProtectedRoute from "./ProtectedRoute";
import InfoTooltip from "./InfoTooltip";

function App() {
  //popups
  const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] =
    React.useState(false);
  const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
  const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] =
    React.useState(false);
  const [selectedCard, setSelectedCard] = React.useState({
    link: "",
    name: "",
  });
  const [isImagePopupOpen, setIsImagePopupOpen] = React.useState(false);
  const [currentUser, setCurrentUser] = React.useState({});

  const [cards, setCards] = React.useState([]);

  //login
  const [loggedIn, setLoggedIn] = React.useState(false);
  const [authPopupState, setAuthPopupState] = React.useState(false);
  const [mode, setMode] = React.useState(false);
  const [message, setMessage] = React.useState({ message: "" });

  //userInfo
  const [userEmail, setUserEmail] = React.useState("");
  const [userPassword, setUserPassword] = React.useState("");
  const [registered, setRegistered] = useState(false);
  const [token, setToken] = useState(localStorage.getItem("token"));

  const history = React.useHistory();

  function handleEditProfileClick() {
    setIsEditProfilePopupOpen(true);
  }
  function handleAddPlaceClick() {
    setIsAddPlacePopupOpen(true);
  }
  function handleEditAvatarClick() {
    setIsEditAvatarPopupOpen(true);
  }
  function handleCardClick(card) {
    setSelectedCard({ link: card.link, name: card.name });
    setIsImagePopupOpen(true);
  }
  function closeAllPopups(evt) {
    setIsEditProfilePopupOpen(false);
    setIsAddPlacePopupOpen(false);
    setIsEditAvatarPopupOpen(false);
    setIsImagePopupOpen(false);
  }
  function handleUpdateUser(info) {
    api
      .editUserInfo(info, token)
      .then((newUser) => {
        setCurrentUser(newUser);
        closeAllPopups();
      })
      .catch((err) => {
        console.log(err);
      });
  }
  function handleUpdateAvatar(avatarInput) {
    api
      .editAvatar(avatarInput.avatar, token)
      .then((newUser) => {
        setCurrentUser(newUser);
        closeAllPopups();
      })
      .catch((err) => {
        console.log(err);
      });
  }
  function handleCardLike(card) {
    const isLiked = card.likes.some((i) => i._id === currentUser._id);
    api.changeLikeCardStatus(card._id, !isLiked, token).then((newCard) => {
      setCards((state) => state.map((c) => (c._id === card._id ? newCard : c)));
    });
  }
  function handleCardDelete(cardProps) {
    api
      .deleteCard(cardProps.card._id, token)
      .then(() => {
        const newCards = cards.filter((c) => {
          return c._id !== cardProps.card._id;
        });
        setCards(newCards);
      })
      .catch((err) => {
        console.log(err);
      });
  }
  function handleAddPlaceSubmit(cardProps) {
    api
      .postNewCard(cardProps, token)
      .then((newCard) => {
        setCards([newCard, ...cards]);
        closeAllPopups();
      })
      .catch((err) => {
        console.log(err);
      });
  }
  //resetForm
  function resetForm() {
    setUserEmail("");
    setUserPassword("");
  }

  //login
  function closePopup() {
    setAuthPopupState(false);
  }

  function renderSuccess() {
    setMode(true);
    setAuthPopupState(true);
    setMessage({ message: "¡Correcto! Ya estás registrado." });
  }

  function renderFailure() {
    setMode(false);
    setAuthPopupState(true);
    setMessage({
      message: "Uy, algo salió mal. Por favor, inténtalo de nuevo.",
    });
  }

  function authorize(e) {
    e.preventDefault();
    auth
      .authorize(userEmail, userPassword)
      .then((data) => {
        if (data && data.token) {
          setToken(data.token);
          localStorage.setItem("token", data.token);
          history.push("/main");
          setLoggedIn(true);
        } else {
          resetForm();
          if (!email || !password) {
            renderFailure();
            throw new Error("400 - Uno o mas de los valores no se han llenado");
          }
        }
        if (!data) {
          renderFailure();
          throw new Error("Uy, algo salió mal.");
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }

  //signup
  function register(e) {
    e.preventDefault();
    auth
      .register(userEmail, userPassword)
      .then((res) => {
        if (!(res && res._id)) {
          renderFailure();
          if (res.status === 409) {
            return Promise.reject(new Error("(Conflict) - User already taken"));
          }
        }
        renderSuccess();
      })
      .then((res) => {
        setRegistered(true);
        history.push("/signin");
        return res;
      })
      .then(resetForm)
      .catch((err) => {
        console.log(err);
      });
  }

  //logout
  function signOut() {
    localStorage.removeItem("jwt");
    setLoggedIn(false);
    setUserEmail("");
    history.push("/signin");
  }

  React.useEffect(() => {
    if (token) {
      auth
        .getContent(token)
        .then((res) => {
          if (res) {
            setLoggedIn(true);
            props.setUserEmail(res.data.email);
          }
        })
        .catch((err) => {
          console.log(err);
        });
    } else {
      setLoggedIn(false);
    }
  }, [token]);

  React.useEffect(() => {
    api
      .getUserInfo(token)
      .then((res) => {
        setCurrentUser(res);
      })
      .then(() => {
        api
          .getInitialCards(token)
          .then((res) => {
            setCards(
              res.map((card) => ({
                link: card.link,
                name: card.name,
                likes: card.likes,
                _id: card._id,
                owner: card.owner,
              }))
            );
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
        console.log(err);
      });
  }, [token]);

  return (
    <CurrentUserContext.Provider value={currentUser}>
      <div className="page">
        <Switch>
          <Route path="/signin">
            <Header
              redirect="Cerrar Sesión"
              link="/signin"
              email={props.email}
              signOut={props.signOut}
            />
            <div className="loginContainer">
              <Login
                loggedIn={loggedIn}
                title="Iniciar Sesión"
                value="¿Aún no eres miembro? Regístrate aquí"
                link="/register"
                redirect="Regístrate"
                setLoggedIn={setLoggedIn}
                signOut={signOut}
                renderFailure={renderFailure}
                renderSuccess={renderSuccess}
                authorize={authorize}
                userEmail={userEmail}
                userPassword={userPassword}
                setUserEmail={setUserEmail}
                setUserPassword={setUserPassword}
              />
              <InfoTooltip
                popupState={authPopupState}
                closePopup={closePopup}
                message={message}
                mode={mode}
              />
            </div>
          </Route>
          <Route path="/signup">
            <Header
              redirect="Cerrar Sesión"
              link="/signup"
              email={props.email}
              signOut={props.signOut}
            />
            <div className="registerContainer">
              <Register
                loggedIn={loggedIn}
                title="Regístrate"
                value="¿Ya eres miembro? Inicia sesión aquí"
                link="/login"
                redirect="Inicia sesión"
                setLoggedIn={setLoggedIn}
                signOut={signOut}
                renderFailure={renderFailure}
                renderSuccess={renderSuccess}
                register={register}
                userEmail={userEmail}
                userPassword={userPassword}
                setUserEmail={setUserEmail}
                setUserPassword={setUserPassword}
              />
              <InfoTooltip
                popupState={authPopupState}
                closePopup={closePopup}
                message={message}
                mode={mode}
              />
            </div>
          </Route>
          <Route path="/main">
            <Footer />
            <EditProfilePopup
              isOpen={isEditProfilePopupOpen}
              onClose={closeAllPopups}
              onUpdateUser={handleUpdateUser}
            />
            <AddPlacePopup
              isOpen={isAddPlacePopupOpen}
              onClose={closeAllPopups}
              onAddPlaceSubmit={handleAddPlaceSubmit}
            />
            <EditAvatarPopup
              isOpen={isEditAvatarPopupOpen}
              onClose={closeAllPopups}
              onUpdateAvatar={handleUpdateAvatar}
            />
            <PopupWithForm
              name="delete"
              title="¿Estás seguro?"
              buttonValue="Sí"
              onClose={closeAllPopups}
            ></PopupWithForm>
            <ImagePopup
              isOpen={isImagePopupOpen}
              link={selectedCard.link}
              name={selectedCard.name}
              onClose={closeAllPopups}
            />
          </Route>
          <ProtectedRoute
            path="/main"
            loggedIn={loggedIn}
            email={userEmail}
            component={Main}
            signOut={signOut}
            closePopup={closePopup}
            message={message}
            mode={mode}
            setUserEmail={setUserEmail}
          />
          <Route>
            {loggedIn ? <Redirect to="/main" /> : <Redirect to="/signin" />}
          </Route>
        </Switch>
      </div>
    </CurrentUserContext.Provider>
  );
}

export default App;
